import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <nav className="nav">
        <ul className="nav-list">
          <li>
            <Link to="/" className="nav-link">메인</Link>
          </li>
          <li>
            <Link to="/cart" className="nav-link">카트</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
